import { useState, useEffect } from "react";
import styles from "./header.module.css";

function Header() {
  return (
    <div className={styles.container}>
      <ul className={styles.nav}>
        <li>Play Game</li>
        <li>Log In</li>
      </ul>
    </div>
  );
}

export default Header;
